import React, { useState } from 'react';
import './css/RegistrationPage.css'; // Подключаем CSS файл 

function RegistrationPage() {
  const [lastName, setLastName] = useState('');
  const [firstName, setFirstName] = useState('');
  const [middleName, setMiddleName] = useState('');
  const [phone, setPhone] = useState('');
  const [email, setEmail] = useState('');
  const [address, setAddress] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');

  const handleRegistration = (event) => {
    event.preventDefault();

    // Проверка Фамилии
    if (!/^[\u0410-\u042f\u0430-\u044f]+$/u.test(lastName)) {
      setError('Фамилия должна быть написана на русском одним словом');
      return;
    }

    // Проверка Имени
    if (!/^[\u0410-\u042f\u0430-\u044f]+$/u.test(firstName)) {
      setError('Имя должно быть написано на русском одним словом');
      return;
    }

    // Проверка Email
    if (!/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(email)) {
      setError('Email должен быть в формате example@mail.com');
      return;
    }

    // Проверка Телефона
    if (!/^79\d{9}$/.test(phone)) {
      setError('Телефон должен начинаться с 79 и содержать 11 цифр');
      return;
    }

    // Проверка Пароля
    if (!/^\d{6}$/.test(password)) {
      setError('Пароль должен состоять из 6 цифр');
      return;
    }

    // Ваша логика регистрации здесь
  };

  const getInputClass = (inputValue) => {
    return !inputValue ? 'input error' : 'input';
  };

  return (
    <div className="container">
      <form className="form" onSubmit={handleRegistration}>
        <h2 className="title">РЕГИСТРАЦИЯ</h2>
        <div className="input-container">
          <label>Фамилия:</label>
          <input
            className={getInputClass(lastName)}
            type="text"
            value={lastName}
            onChange={(e) => { setError(''); setLastName(e.target.value); }}
            placeholder="Введите фамилию"
          />
          {!lastName && <p className="error">Поле не может быть пустым</p>}
        </div>
        <div className="input-container">
          <label>Имя:</label>
          <input
            className={getInputClass(firstName)}
            type="text"
            value={firstName}
            onChange={(e) => { setError(''); setFirstName(e.target.value); }}
            placeholder="Введите имя"
          />
          {!firstName && <p className="error">Поле не может быть пустым</p>}
        </div>
        <div className="input-container">
          <label>Отчество (при наличии):</label>
          <input
            className="input"
            type="text"
            value={middleName}
            onChange={(e) => { setError(''); setMiddleName(e.target.value); }}
            placeholder="Введите отчество"
          />
        </div>
        <div className="input-container">
          <label>Телефон:</label>
          <input
            className={getInputClass(phone)}
            type="tel"
            value={phone}
            pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}"
            onChange={(e) => { setError(''); setPhone(e.target.value); }}
            placeholder="Введите номер телефона"
          />
          {!phone && <p className="error">Поле не может быть пустым</p>}
        </div>
        <div className="input-container">
          <label>Email:</label>
          <input
            className={getInputClass(email)}
            type="email"
            value={email}
            onChange={(e) => { setError(''); setEmail(e.target.value); }}
            placeholder="example@mail.com"
          />
          {!email && <p className="error">Поле не может быть пустым</p>}
        </div>
        <div className="input-container">
          <label>Адрес:</label>
          <input
            className={getInputClass(address)}
            type="text"
            value={address}
            onChange={(e) => { setError(''); setAddress(e.target.value); }}
            placeholder="Введите адрес"
          />
          {!address && <p className="error">Поле не может быть пустым</p>}
        </div>
        <div className="input-container">
          <label>Пароль:</label>
          <input
            className={getInputClass(password)}
            type="password"
            value={password}
            onChange={(e) => { setError(''); setPassword(e.target.value); }}
            placeholder="Введите пароль"
          />
          {!password && <p className="error">Поле не может быть пустым</p>}
        </div>
        {error && <p className="error">{error}</p>}
        <input className="button" type="submit" value="РЕГИСТРАЦИЯ" />
      </form>
    </div>
  );
}

export default RegistrationPage;
